This post is not meant to shame in any way, and is created to inform because you can’t do better unless you know all the info. I didn’t know how toxic some diapers were until this time around, which is why I made a conscious effort to try the safer options.

Cloth diapers are the safest option. I personally didn’t want to go that route because it’s not as convenient in my opinion unless you use a service.

My top two:

@kudostobaby code MAMAJOTES
  I love everything about these diapers. They are considered the cleanest and safest diapers on the market and it’s 100% cotton that touches my babies butt. No diaper rashes, leak free nights, great fit and we haven’t had any blowout in this specific diaper because of the fit. Fun fact: It’s founded by a South Asian woman, which I absolutely love! 
@mypura available at Walmart. This diaper recently came to the US from the UK and they have much better standards over there. I like that his diaper is super thin, but insanely absorbent. It fits great, and it feels great and I haven’t seen any redness or reading on baby. 

Other options:
@milliemoon - a fantastic option and comparable to coterie for a fraction of the cost
@huggies special delivery - we used this when he was a newborn and they were great
pampers pure - I haven’t tried it, but I’ve heard good things
@dyper - basic diaper. Does the job
@hellobello - they have really cute prints, but I found that they did leave my babies bottom a little bit red. 
@coterie - a luxury diaper that literally feels so soft & it worked great. 
@honest - not my favorite diaper because I didn’t like the way they felt or the way they fit, but an option. 
@healthybaby - I haven’t tried this one, but they are EWG certified.

Was is this news to you? Which diapers have you tried and loved? Let me know in the comments.

